$_MODULE['<{upela}prestashop>conf_guide_1aa5d3f5ca33836cb6894656e0c7b1cd'] = 'Dans l’onglet « Paramètres », retrouvez toutes les informations concernant votre/vos boutique(s), ainsi que vos informations d’expédition et de paiement.';
$_MODULE['<{upela}prestashop>conf_guide_7369824ba15ebeff089cefe44be63c76'] = 'Information d’expédition ';
