$_MODULE['<{upela}prestashop>conf_guide_706e328b6c1b71e940b61c17768c314f'] = 'SEPA : suivez les 3 étapes de validation de la demande de prélèvement, n’oubliez pas de télécharger les 3 fichiers demandés (Mandat SEPA, K-bis et RIB) en étape 3.';
$_MODULE['<{upela}prestashop>conf_guide_c5c1bf845c18158a31f3d2dcd4bc72d0'] = '3) Configurez vos transporteurs ';
$_MODULE['<{upela}prestashop>conf_guide_ce90a0a6cb2c9ef9680ec873d036faac'] = 'Dans l’onglet « Transporteurs », choisissez parmi la liste des transporteurs ceux que vous souhaitez afficher sur votre boutique en ligne. Les transporteurs sont classés selon le mode de livraison : Relais, Standard ou Express.';
$_MODULE['<{upela}prestashop>conf_guide_62b6366e3482a64c76982ec85930ef4c'] = 'Cochez ou décochez le transporteur que vous souhaitez activer sur votre boutique dans la colonne « Statut ». Cliquez ensuite sur « Paramétrer ».';
$_MODULE['<{upela}prestashop>conf_guide_316994649b8378dcaccd950af15a690f'] = 'Les paramètres du transporteur sélectionné s’affichent. Dans l’onglet « 2 Destinations d’expédition et coûts », les tarifs d’expédition s’appliquent automatiquement selon vos paramètres d’expédition par défaut, renseignés dans l’étape 2.';
$_MODULE['<{upela}prestashop>conf_guide_b3565dd8e3cb2e44a65a67e5e2293718'] = 'Pour modifier ces tarifs et la liste des pays destinataires, il vous suffit de cocher ou de décocher les destinations et de renseigner les tarifs que vous souhaitez afficher sur votre boutique. ';
$_MODULE['<{upela}prestashop>conf_guide_c05f34f40f6d08b9041b60dca4d892cc'] = 'Dans l’onglet « 3 Taille, poids et groupes associés », indiquez les dimensions maximum du colis que vous souhaitez envoyer avec ce transporteur.';
$_MODULE['<{upela}prestashop>conf_guide_c741b85c5e777790cc5cbb2fc5b8e3f7'] = 'Cliquez sur « Terminer » pour finaliser la configuration de votre transporteur.';
$_MODULE['<{upela}prestashop>conf_guide_83a4e73a1d83c79646e4171d557d931a'] = 'Si vous souhaitez ajouter un ou plusieurs autres transporteurs, répétez l’étape 3.';
$_MODULE['<{upela}prestashop>conf_guide_24d4997cd5c3be7831023974ece58b62'] = '4)	Expédiez en 2 clics ';
$_MODULE['<{upela}prestashop>conf_guide_88064a6564a3158e140260eda4721637'] = 'Depuis le menu PrestaShop, rendez-vous dans la section « Commandes ». La liste des commandes passées dans votre e-boutique apparaît. Cliquez sur la commande choisie pour l’expédier. ';
$_MODULE['<{upela}prestashop>conf_guide_7cb61b6f98e3a61a0dca17b117735611'] = 'Dans la section « Expédiez avec Upela » vos paramètres d’expédition par défaut s’affichent, il vous suffit de renseigner le contenu de votre colis. Cliquez ensuite sur « Expédier ».';
